import React, { useState } from "react";
import { FaArrowRight, FaArrowLeft } from "react-icons/fa";

const projects = [
  { title: "Bally Website Research", category: "UX case study", image: "/your-image-path1.jpg" },
  { title: "Bally Website Research", category: "UX case study", image: "/your-image-path2.jpg" },
  { title: "Bally Website Research", category: "UX case study", image: "/your-image-path3.jpg" },
  { title: "Bally Website Research", category: "UX case study", image: "/your-image-path4.jpg" }
];

const testimonials = [
  {
    quote: "File storage made easy – including powerful features you won’t find anywhere else.",
    author: "Larry Diamond",
    position: "Chief Executive Officer, Besnik",
    image: "/your-testimonial-image.jpg"
  },
  {
    quote: "Great design work! It has helped improve our brand and user experience significantly.",
    author: "Jessica Smith",
    position: "Product Manager, TechCorp",
    image: "/your-testimonial-image2.jpg"
  }
];

export default function Works() {
  const [visibleProjects, setVisibleProjects] = useState(4);
  const [currentTestimonial, setCurrentTestimonial] = useState(0);

  const handleNextTestimonial = () => {
    setCurrentTestimonial((prev) => (prev + 1) % testimonials.length);
  };

  const handlePrevTestimonial = () => {
    setCurrentTestimonial((prev) => (prev - 1 + testimonials.length) % testimonials.length);
  };

  return (
    <div className="p-8 md:p-16">
      {/* Recent Projects */}
      <h2 className="text-gray-500 italic">Work</h2>
      <h1 className="text-4xl md:text-6xl font-bold mb-8">RECENT PROJECT</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {projects.slice(0, visibleProjects).map((project, index) => (
          <div key={index} className="flex flex-col">
            <img src={project.image} alt={project.title} className="rounded-lg shadow-lg" />
            <div className="mt-4">
              <p className="text-gray-500 uppercase">{project.category}</p>
              <h3 className="text-2xl font-semibold flex items-center gap-2">
                {project.title} <FaArrowRight />
              </h3>
            </div>
          </div>
        ))}
      </div>

      {/* Load More Button */}
      {visibleProjects < projects.length && (
        <button
          onClick={() => setVisibleProjects((prev) => prev + 2)}
          className="mt-8 bg-black text-white px-6 py-3 rounded-lg hover:bg-gray-800 transition"
        >
          Load more <FaArrowRight className="inline ml-2" />
        </button>
      )}

      {/* Testimonials Section */}
      <div className="mt-16 p-8 md:p-16 rounded-lg shadow-lg bg-gradient-to-r from-purple-500 to-orange-500 text-white flex flex-col md:flex-row items-center">
        <img src={testimonials[currentTestimonial].image} alt="Testimonial" className="w-40 md:w-56 rounded-lg shadow-lg" />
        <div className="ml-6">
          <h3 className="italic text-sm">Testimonial</h3>
          <h2 className="text-3xl md:text-5xl font-bold mt-2">WHAT THEY SAYS</h2>
          <p className="mt-4 text-lg italic">“ {testimonials[currentTestimonial].quote} ”</p>
          <p className="mt-4 font-bold">{testimonials[currentTestimonial].author}</p>
          <p className="text-sm">{testimonials[currentTestimonial].position}</p>
          {/* Testimonial Navigation */}
          <div className="flex mt-4 space-x-4">
            <button onClick={handlePrevTestimonial} className="p-2 bg-white text-black rounded-full hover:bg-gray-300">
              <FaArrowLeft />
            </button>
            <button onClick={handleNextTestimonial} className="p-2 bg-white text-black rounded-full hover:bg-gray-300">
              <FaArrowRight />
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
